func handleRequest(w dns.ResponseWriter, req *dns.Msg) {
	m := new(dns.Msg)
	m.SetReply(req)

	for _, r := range req.Question {
		qtype := fmt.Sprintf("%s", dns.TypeToString[r.Qtype])
		cacheLock.Lock()
		ip, exists := cache[r.Name]
		cacheLock.Unlock()

		if exists {
			m.Answer = append(m.Answer, &dns.TXT{
				Hdr: dns.RR_Header{
					Name:   r.Name,
					Rrtype: dns.TypeTXT,
					Class:  dns.ClassINET,
					Ttl:    60,
				},
				Txt: []string{ip},
